function isSet(t){return!(null==t)}function arrayColumn(t,n){return t.map((t=>t[n]))}function getTemplate(t){return $(`[data-template="${t}"]`).first().clone(!0).removeAttr("data-template")}function randomProperty(t){const n=Object.keys(t);return t[n[n.length*Math.random()<<0]]}function randomItem(t){return t[Math.floor(Math.random()*t.length)]}function random(t,n){return Math.floor(Math.random()*(n-t+1)+t)}$.fn.shuffleChildren=function(){$.each(this.get(),(function(t,n){var r=$(n),e=r.children();e.sort((function(){return.5-Math.random()})),r.empty(),e.appendTo(r)}))};